Vallis-Solaris:
  Name: Vallis Solaris
  Description: |
    Located in the depths of a canyon, this city
    grew from a small collection of tribal villages
    situated alongside its ridges. As time would
    have it, their need for trade eventually led
    to various mercantile outposts. This inevitably
    led to the forming and joining of outposts
    until these villages and outposts, known as the
    Valles Solaris, became known as the one Vallis
    Solaris.
  Lore: |+
    As the sun god Eifrittis drove the people of
    Tanaeum out from the whithering forests, they
    found respite through the blessing of Alzim's
    shadow. The god Alzim had carved, so many ages
    ago, a long rift in the sands, so as to show
    might over Eifrittis's never-ending light and
    to turn his own efforts into creating shadows
    of respite.

    It was at their final place, at the deepest
    part of the canyon, that the Vallis Solaris
    was formed with the blessing of Alzim!

  Depth: 50
  Width: 50
  Height: 25
  Darkness: 0
  ResetTime: 0
